{
	int i,j,day;;
	char data[5],a[10];

	for(i=0;i<=9;i++)
		a[i]=(i+1)*(i+2)/2;
	gets(data);
	while(data[0]!='0'&&data[2]!='0'){
		i=j=0;
		while(data[i]!='\0')
			i++;
		if(i==4)
			day=(data[0]-'7')*31+10*(data[2]-'0')+data[3]-'0';
		else 
			day=(data[0]-'7')*31+data[2]-'0';
		for(i=0;i<=9;i++)
			if(day<=a[i])
				j++;
			printf("%d\n",j);
			gets(data);
	}
}

