#include <stdio.h>
#include <stdlib.h>

#define MAXN 1001
int horses1[MAXN];
int horses2[MAXN];

int compare (const void * a, const void * b)
{
  return ( *(int*)a - *(int*)b );
}

int main()
{
  int n, i, j, t, end;
  while(scanf("%d", &n), n)
  {
     for (i = 0; i < n; ++i)
        scanf("%d", &horses1[i]);
     for (i = 0; i < n; ++i)
        scanf("%d", &horses2[i]);

     qsort(horses1, n, sizeof(int), compare);
     qsort(horses2, n, sizeof(int), compare);

     t = 0; 
     end = n - 1;
     for (i = n - 1; i >= 0; --i)
        for (j = end; j >= 0; --j)
          if (horses1[i] > horses2[j])
          {
             ++t;
             end = j - 1;
             break;
          }
     if (t > n / 2) printf("YES\n");
       else printf("NO\n");
  }
  return 0;
}

#include<stdio.h>
#include<string.h>
struct node
{
	int x,y;
}que[401];
char visited[21][21];
int xs,ys,xe,ye,head,tail,pt,n,m;
int go[4][2]={{0,1},{1,0},{-1,0},{0,-1}};
int bfs(int x1,int y1,int x2,int y2)
{
	int i,x,y,step=0,k;
	head=pt=0;
	tail=1;
	que[0].x=x1;
	que[0].y=y1;
	while(head<tail)
	{
		pt=tail;
		step++;
		for(k=head;k<tail;k++)
		{
			for(i=0;i<4;i++)
				{
					x=que[k].x+go[i][0];
					y=que[k].y+go[i][1];
					if(x>=0&&x<m&&y>=0&&y<n&&visited[x][y]!='*')
					{
						que[pt].x=x;
						que[pt++].y=y;
						visited[x][y]='*';
					}
					if(x==x2&&y==y2) return step;
				}
		}
		head=tail;
		tail=pt;
	}
	return -1;
}
int main()
{
	int t,res;
	int i,j;
	while(scanf("%d%d%d",&n,&m,&t),n||m||t)
	{
		getchar();
		for(i=0;i<m;i++)
		   gets(visited[i]);
		for(i=0;i<m;i++)
		{		
			for(j=0;j<n;j++)
			{
				if(visited[i][j]=='S')
				{
					xs=i,ys=j;
					visited[i][j]='*';
				}	
				if(visited[i][j]=='P')
					xe=i,ye=j;
			}

		}
			res=bfs(xs,ys,xe,ye);
			if(res>-1&&res<=t)printf("YES\n");
			else printf("NO\n");
	}
	return 0;
}

#include <math.h>
#include <stdio.h>
#include <stdlib.h>

#define size 3200
int pm[446] = {2,3,5};
int total = 3;
int abc;
int num;
int Len;

void R(int n, int b, int sum)
{
	if (n < Len)
	{
		int i, tmp;
		for (i = b; i < total - Len + 1 + n; i++)
		{
			tmp = num;
			R(n + 1, i + 1, sum * pm[i]);
			if (tmp == num) return;
		}
	}
	else
	{
		num += abc / sum;
	}
}

int B(int len)
{
	int left = 0;
	int right = 445;
	int middle;

	while (left < right)
	{
		middle = (left + right) / 2;
		if (pm[middle] > len)
			right = middle - 1;
		else if (pm[middle] < len)
			left = middle + 1;
		else
			return middle + 1;
	}
	return pm[left] <= len ? left + 1 : left;
}

int creat_prime(int prime[],int n,int total)
{
	int	i, j;
	int	gab=2;
	int	count;
	for(i=7;i<=n;i+=gab)
	{
		count=1;
		gab=6-gab;
		for(j=0;prime[j]*prime[j]<=i;j++)
		{
			if(i%prime[j]==0)
			{
				count=0;
				break;
			}
		}
		if(count)
		{
			prime[total]=i;
			total++;
		}
	}

	return total;
}

int main(void)
{
	int len;
	int count = 2;

	total=creat_prime(pm,3162,total);
	while (scanf("%d", &abc), abc)
	{
		total = B((int)(sqrt(abc) + 0.5));
		for (len = 0, Len = 1; Len <= total; Len++)
		{
			num = 0;
			R(0, 0, 1);
			if (!num) break;
			Len % 2 ? (len -= num) : (len += num);
		}
		printf("%d\n", total - 1 + abc + len);
	}

	return 0;
}

#include<stdio.h>
#include<memory.h>
int a[45];
int total(int n)
{
	if(n==1||n==2)return n;
	else 
	{
		if(a[n]==0)
			a[n]=total(n-1)+total(n-2);
		return a[n];
	}
}
main()
{
	int n;
	int m;
	memset(a,0,(sizeof(a[0]))*45);
	scanf("%d",&n);
	while(n)
	{
		m=total(n);
		printf("%d",m);
		printf("\n");
		scanf("%d",&n);
	}
	return 0;
}

