void main()
{
	char tran1[]=" E C F A J K L B D G H I V W Z Y M N O P Q R S T U X",tran2[]=" e r w q t y g h b n u i o p s j k d l f a z x c v m",s1[1000],s2[1000],s[]="#";
	int i;
	gets(s1);

	while(strcmp(s1,s)!=0)
	{

		for(i=0;s1[i]!='\0';i++)
		{
			if(s1[i]>='a'&&s1[i]<='z')
			{
				s2[i]=tran2[(s1[i]-'a'+1)*2-1];
			}
			else if(s1[i]>='A'&&s1[i]<='Z')
			{
				s2[i]=tran1[(s1[i]-'A'+1)*2-1];
			}
			else
				s2[i]=s1[i];

		}
		s2[i]='\0';
		puts(s2);
		gets(s1);

	}
}

#include <stdio.h>
#include <string.h>

int main(void)
{
	int i, j, len;
	char code[1024] = " ", tmp;

	while (gets(code + 1))
	{
		len = strlen(code) - 1;
		for (i = len / 2; i; i--)
		{
			if (i % 2)
			{
				tmp = code[i];
				for (j = i; j + i <= len; j += i)
					code[j] = code[j + i];
				code[j] = tmp;

			}
			else
			{
				tmp = code[len/i*i];
				for (j = len/i*i; j; j -= i)
					code[j] = code[j - i];
				code[i] = tmp;
			}
		}
		puts(code + 1);
	}

	return 0;
}

#include<stdio.h>
int main()
{
    int n,x,s,a,i,j,t,p[1000];
    while(scanf("%d",&n)&&n)
    {
        while(scanf("%d",&x)&&x)
        {
            s=x-1;
            for(j=0;j<x;j++)
                p[j]=j;
            a=x+1;
            t=1;
            for(i=1;i<n;i++)
            {
            scanf("%d",&x);
            if(t)
            if(x>=a||x==p[s])
            {
                if(x==p[s])
                s--;
                else if(x>=a)
                {
                for(j=a;j<x;j++)
                p[j-a+s+1]=j;
                s+=x-a;
                a=x+1;
                }
            }
            else t=0;
            }
    if(t) printf("Yes\n");
    else printf("No\n");
        }
        printf("\n");
    }
    return 0;
}
